import React from 'react';
import bg19 from '../img/bg19.jpg';
import '../styles/voluntario.css';
import { FacebookOutlined } from '@ant-design/icons';
import 'antd/dist/antd.css';


export default function Voluntario() {
 return (
   <div className="ffullpage" style={{ backgroundImage: `url(${bg19})` }}>
     <div className="join"><h1>Torne-se um voluntario.</h1></div>       
       <div className="vfull">
         <div className="smb">
           <li><FacebookOutlined style={{ fontSize: '30px', color: '#08c'}} /></li>           
         </div>
         <div className="smb">
           <li><FacebookOutlined style={{ fontSize: '30px', color: '#08c'}} /></li>           
         </div>
         <div className="smb">
           <li><FacebookOutlined style={{ fontSize: '30px', color: '#08c'}} /></li>           
         </div>


       </div>

   </div>
 );
}
